import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Navbar from "./components/nav/navbar.js"

function App() {
  return (
    <Router>
      < Navbar />
      <Switch>
        <Route path='/' />
        <Route path='/about' />
      </Switch>
    </Router>

  );
}

export default App;
